// SPDX-License-Identifier: Unlicensed

pragma solidity >=0.4.0 <0.9.0;

/**
 * A simple ToDo smart contract app
 *
 */
contract ToDoApp {
    /**
     * Data types
     */
    address owner;
    uint public counter;
    struct ToDo {
        uint256 id;
        string name;
        string content;
        bool status; // done = true, not done = false
    }

    /**
     * Mappings
     */
    mapping(uint256 => ToDo) public todos;

    /**
     * Constructor
     */
    constructor() {
        owner = msg.sender;
    }

    /**
     * Add new todo to memory. ID defaults to counter index and status defaults to false
     */
    function addTodo(
        string memory name,
        string memory content
    ) public {
        todos[counter] = ToDo(counter, name, content, false);

        /* Update counter by one */
        counter++;
    }

    /**
     * Get todo
     */
    function getTodo(uint id) public view returns(ToDo memory) {
        return todos[id];
    }


    /**
     * Get amount of todos
     */
    function getAmount() public view returns(uint){
        return counter;
    }

    /**
     * Set todo as done
     */
    function setAsDone(uint id) public {
        todos[id].status = true;
    }

    /**
     * Set todo as undone
     */
    function setAsUndone(uint id) public {
        todos[id].status = false;
    }
}

